import React, { Component } from 'react';

class Contact extends Component {
  render() {
    return (
      <div>
        <h1>John Doe</h1>
        <ul>
          <li>Email: john.doe@gmail.com</li>
          <li>Contact: 555-555-5555</li>
        </ul>
      </div>
    );
  }
}

export default Contact;
